// Navbar.js
import React from 'react';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/Button';
import { useAuth } from '../AuthContext';
import { useNavigate } from 'react-router-dom';

function NavbarComponent() {
    const { user, logout } = useAuth();
    const navigate = useNavigate();

    const handleCreatePost = () => {
        navigate('/create-post');
    };

    const handlePatientPage = () => {
        navigate('/patient-page');
    };

    return (
        <Navbar expand="lg" className="bg-body-tertiary">
            <Container>
                <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse className="justify-content-end">
                    {user ? (
                        <>
                            <Navbar.Text>
                                Welcome, {user.username}!
                            </Navbar.Text>
                            <Button variant="outline-danger" onClick={logout}>
                                Logout
                            </Button>
                            {user.role === 'patient' && (
                                <>
                                    <Button variant="outline-primary" onClick={handleCreatePost}>
                                        Create Post
                                    </Button>
                                    <Button variant="outline-primary" onClick={handlePatientPage}>
                                        Patient Page
                                    </Button>
                                </>
                            )}
                        </>
                    ) : (
                        <>
                            <Button variant="outline-success" onClick={() => navigate('/register')} className="mx-2">
                                Register
                            </Button>
                            <Button variant="outline-primary" onClick={() => navigate('/login')}>
                                Login
                            </Button>
                        </>
                    )}
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
}

export default NavbarComponent;
